using Fnunez.VeterinaryClinic.Scheduling.Application.SharedModel.Appointment;
using Fnunez.VeterinaryClinic.Scheduling.Application.SharedModel.Appointment.CreateAppointment;
using Fnunez.VeterinaryClinic.Scheduling.Application.SharedModel.Appointment.UpdateAppointment;
using Fnunez.VeterinaryClinic.Scheduling.BlazorClient.Client.ViewModels.Appointments;

namespace Fnunez.VeterinaryClinic.Scheduling.BlazorClient.Client.Helpers;

public static class AppointmentHelper
{
    public static string GetDemoDoctorPhoto()
    {
        return "data:image/png;base64,";
    }

    public static string GetDemoPatientPhoto()
    {
        return "data:image/png;base64,";
    }

    public static AppointmentItemVm MapAppointmentItemViewModel(
        AppointmentDto appointmentDto,
        int timezoneOffset)
    {
        var endOn = appointmentDto.EndOn
            .ToOffset(TimeSpan.FromMinutes(timezoneOffset)).DateTime
            .ToUnspecifiedKind();

        var startOn = appointmentDto.StartOn
            .ToOffset(TimeSpan.FromMinutes(timezoneOffset)).DateTime
            .ToUnspecifiedKind();

        return new AppointmentItemVm
        {
            AppointmentId = appointmentDto.AppointmentId,
            AppointmentTypeId = appointmentDto.AppointmentTypeId,
            ClientId = appointmentDto.ClientId,
            ClientFullName = appointmentDto.ClientFullName,
            ClinicId = appointmentDto.ClinicId,
            ClinicName = appointmentDto.ClinicName,
            Description = appointmentDto.Description,
            DoctorId = appointmentDto.DoctorId,
            EndOn = endOn,
            IsConfirmed = appointmentDto.IsConfirmed,
            PatientId = appointmentDto.PatientId,
            PatientName = appointmentDto.PatientName,
            RoomId = appointmentDto.RoomId,
            StartOn = startOn,
            Title = appointmentDto.Title
        };
    }

    public static List<AppointmentVm> MapAppointmentViewModels(
        List<AppointmentDto> appointmentDtos,
        int timezoneOffset)
    {
        List<AppointmentVm> appointments = new();

        foreach (var appointmentDto in appointmentDtos)
        {
            AppointmentVm appointment = MapAppointmentViewModel(
                appointmentDto, timezoneOffset);

            appointments.Add(appointment);
        }

        return appointments;
    }

    public static CreateAppointmentRequest MapCreateAppointmentRequest(
        AppointmentItemVm Appointment,
        int timezoneOffset)
    {
        var startOn = new DateTimeOffset(
                Appointment.StartOn.ToUnspecifiedKind(),
                TimeSpan.FromMinutes(timezoneOffset)
            );

        var endOn = new DateTimeOffset(
            Appointment.EndOn.ToUnspecifiedKind(),
            TimeSpan.FromMinutes(timezoneOffset)
        );

        return new CreateAppointmentRequest
        {
            AppointmentTypeId = Appointment.AppointmentTypeId,
            ClientId = Appointment.ClientId,
            ClinicId = Appointment.ClinicId,
            Description = Appointment.Description,
            DoctorId = Appointment.DoctorId,
            EndOn = endOn,
            PatientId = Appointment.PatientId,
            RoomId = Appointment.RoomId,
            StartOn = startOn,
            Title = Appointment.Title
        };
    }

    public static UpdateAppointmentRequest MapUpdateAppointmentRequest(
        AppointmentItemVm Appointment,
        int timezoneOffset)
    {
        var startOn = new DateTimeOffset(
                Appointment.StartOn.ToUnspecifiedKind(),
                TimeSpan.FromMinutes(timezoneOffset)
            );

        var endOn = new DateTimeOffset(
            Appointment.EndOn.ToUnspecifiedKind(),
            TimeSpan.FromMinutes(timezoneOffset)
        );

        return new UpdateAppointmentRequest
        {
            AppointmentId = Appointment.AppointmentId,
            AppointmentTypeId = Appointment.AppointmentTypeId,
            Description = Appointment.Description,
            DoctorId = Appointment.DoctorId,
            EndOn = endOn,
            RoomId = Appointment.RoomId,
            StartOn = startOn,
            Title = Appointment.Title
        };
    }

    private static AppointmentVm MapAppointmentViewModel(
        AppointmentDto appointmentDto,
        int timezoneOffset)
    {
        var endOn = appointmentDto.EndOn
            .ToOffset(TimeSpan.FromMinutes(timezoneOffset)).DateTime
            .ToUnspecifiedKind();

        var startOn = appointmentDto.StartOn
            .ToOffset(TimeSpan.FromMinutes(timezoneOffset)).DateTime
            .ToUnspecifiedKind();

        return new AppointmentVm
        {
            EndOn = endOn,
            Id = appointmentDto.AppointmentId,
            IsConfirmed = appointmentDto.IsConfirmed,
            StartOn = startOn,
            Title = appointmentDto.Title
        };
    }

    public static bool ValidateAppointmentToAdd(
        List<AppointmentVm> storedAppointments,
        AppointmentItemVm currentAppointment)
    {
        if (!ValidateAppointmentRange(
            currentAppointment.StartOn, currentAppointment.EndOn))
            return false;

        foreach (var storedAppointment in storedAppointments)
        {
            bool isValid = ValidateAppointmentTimeCollision(
                storedAppointment, currentAppointment);

            if (!isValid)
                return false;
        }

        return true;
    }

    public static bool ValidateAppointmentToEdit(
        List<AppointmentVm> storedAppointments,
        AppointmentItemVm currentAppointment)
    {
        if (!ValidateAppointmentRange(
            currentAppointment.StartOn, currentAppointment.EndOn))
            return false;

        var storedAppointmentsWithoutEdited = storedAppointments
            .Where(a => a.Id != currentAppointment.AppointmentId);

        foreach (var storedAppointment in storedAppointmentsWithoutEdited)
        {
            bool isValid = ValidateAppointmentTimeCollision(
                storedAppointment, currentAppointment);

            if (!isValid)
                return false;
        }

        return true;
    }

    private static bool ValidateAppointmentTimeCollision(
        AppointmentVm storedAppointment,
        AppointmentItemVm currentAppointment)
    {
        if (!ValidateAppointmentRange(
            storedAppointment.StartOn, storedAppointment.EndOn))
            return false;

        if (ValidateIfStoredAppointmentIsEarlierThanCurrent(
            storedAppointment.StartOn,
            storedAppointment.EndOn,
            currentAppointment.StartOn,
            currentAppointment.EndOn))
            return true;

        if (ValidateIfStoredAppointmentIsNewerThanCurrent(
            storedAppointment.StartOn,
            storedAppointment.EndOn,
            currentAppointment.StartOn,
            currentAppointment.EndOn))
            return true;

        return false;
    }

    private static bool ValidateAppointmentRange(DateTime startOn, DateTime endOn)
    {
        if (startOn == DateTime.MinValue)
            return false;

        if (endOn == DateTime.MinValue)
            return false;

        return startOn < endOn;
    }

    private static bool ValidateIfStoredAppointmentIsEarlierThanCurrent(
        DateTime storedAppointmentStartOn,
        DateTime storedAppointmentEndOn,
        DateTime currentAppointmentStartOn,
        DateTime currentAppointmentEndOn)
    {
        if (!(storedAppointmentStartOn < currentAppointmentStartOn))
            return false;

        if (!(storedAppointmentStartOn < currentAppointmentEndOn))
            return false;

        if (!(storedAppointmentEndOn < currentAppointmentEndOn))
            return false;

        if (!(storedAppointmentEndOn <= currentAppointmentStartOn))
            return false;

        return true;
    }

    private static bool ValidateIfStoredAppointmentIsNewerThanCurrent(
        DateTime storedAppointmentStartOn,
        DateTime storedAppointmentEndOn,
        DateTime currentAppointmentStartOn,
        DateTime currentAppointmentEndOn)
    {
        if (!(storedAppointmentStartOn > currentAppointmentStartOn))
            return false;

        if (!(storedAppointmentStartOn >= currentAppointmentEndOn))
            return false;

        if (!(storedAppointmentEndOn > currentAppointmentEndOn))
            return false;

        if (!(storedAppointmentEndOn > currentAppointmentStartOn))
            return false;

        return true;
    }
}